        // Define headers for the table
        // تعريف رؤوس الجدول
        const headers = [
            'الاسم', 
            'اسم آخر', 
            'الرقم القومي', 
            'جواز السفر', 
            'الجنسية', 
            'رقم القضية', 
            'رقم قرار ادراج الارهابيين', 
            'تاريخ النشر', 
            'عدد النشر'
        ];

        function searchData() {
            const term = document.getElementById('searchBox').value.trim().toLowerCase();
            const resultDiv = document.getElementById('results');

            if (term.length < 2) {
                resultDiv.innerHTML = '<div class="no-results">اكتب حرفين على الأقل للبحث</div>';
                return;
            }

            // Start measuring search time for performance check
            // بدء قياس وقت البحث
            console.time('SearchTime');

            // Search the data
            const filteredData = allData.filter(row => 
                row.some(field => String(field).toLowerCase().includes(term))
            );

            // End measuring search time
            // إنهاء قياس وقت البحث
            console.timeEnd('SearchTime');

            if (filteredData.length === 0) {
                resultDiv.innerHTML = '<div class="no-results">لم يتم العثور على نتائج</div>';
                return;
            }

            // Create table elements
            // إنشاء عناصر الجدول
            const tableWrapper = document.createElement('div');
            tableWrapper.className = 'table-wrapper';

            const table = document.createElement('table');

            // Create table header
            // إنشاء رأس الجدول
            const thead = document.createElement('thead');
            const headerRow = document.createElement('tr');

            headers.forEach(header => {
                const th = document.createElement('th');
                th.textContent = header;
                headerRow.appendChild(th);
            });

            thead.appendChild(headerRow);
            table.appendChild(thead);

            // Create table body
            // إنشاء جسم الجدول
            const tbody = document.createElement('tbody');

            // Display first 500 results for better performance
            // عرض أول 500 نتيجة فقط لأداء أفضل
            const displayData = filteredData.slice(0, 500);

            displayData.forEach(row => {
                const tr = document.createElement('tr');
                row.forEach(field => {
                    const td = document.createElement('td');
                    td.textContent = field;
                    tr.appendChild(td);
                });
                tbody.appendChild(tr);
            });

            table.appendChild(tbody);
            tableWrapper.appendChild(table);

            // Add results count information
            // إضافة معلومات عن عدد النتائج
            const infoDiv = document.createElement('div');
            infoDiv.className = 'info';
            infoDiv.textContent = `عرض ${displayData.length} من أصل ${filteredData.length} نتيجة`;

            resultDiv.innerHTML = '';
            resultDiv.appendChild(infoDiv);
            resultDiv.appendChild(tableWrapper);

            // Add a warning if more results exist
            // إضافة تنبيه إذا كانت هناك نتائج أكثر لم تعرض
            if (filteredData.length > 500) {
                const alertDiv = document.createElement('div');
                alertDiv.className = 'info';
                alertDiv.style.color = '#e74c3c';
                alertDiv.textContent = `ملاحظة: يتم عرض أول 500 نتيجة فقط. ركز بحثك للحصول على نتائج أدق.`;
                resultDiv.appendChild(alertDiv);
            }
        }
    </script>
